import React from "react";
import ".//App.css";
import {Link, NavLink} from "react-router-dom";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Kuvat from "./Navisivut/Kuvat"
import Navbar from "./Navisivut/Navbar";
import Mökki from "./Navisivut/Mökki";


// Nämä alla olevat lisukkeet tarvitsee, jotta voi runnata appia.
// asenna Firebase, react-router-dom, (motion), + muut tulevat lisäosat // npm install react-router-dom@5
function App() {
  return (
    <div className="App">
      <h1>Mökkivaraus sivusto</h1>
    <Router>
    <div className="content">
      <Navbar/>
      <Switch>
        <Route exact path="/">
        </Route>

        <Route exact path="/Kuvat">
          <Kuvat/>
        </Route>

        <Route  exact path="/Mökki">
          <Mökki/>
        </Route>
        
      </Switch>
    </div>
    </Router>
    </div>
  );
}

export default App;
